import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function Adm({ navigation }) {
    
    navigation.setOptions({
        headerTitle: 'Sombra Rosa Cheiro de Flor'
      })

    return (
   <View style={styles.container}>
       <View>
            <Text style={styles.titulo}>PAINEL DE CONTROLE</Text>
       </View>
       <View style={styles.textContainer}>
           <Text style={styles.box}>Categorias</Text>
           <Text style={styles.box}>Produtoss</Text>
           <Text style={styles.box}>Dados da loja</Text>
           <Text style={styles.box}>Sair</Text>
       </View>
   </View>
  );
}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        width: '100%',
        backgroundColor: '#FFF'
    },
    titulo:{
        fontFamily: 'PlayfairDisplay_400Regular',
        fontSize: 26,
        marginHorizontal: '1%'
    },
    textContainer:{
        fontFamily: 'PlayfairDisplay_400Regular',
        fontSize: 16,
        marginHorizontal: '1%'
    },
    box:{
        margin: '100%',
        backgroundColor: '#000'
    }
});
